import React from 'react'
import myData from '../backend/trie';
import Tree from 'react-d3-tree';

const myTreeData = myData;

const VisualSide = () => {
  let data = myData;
  return (
    <Tree
		data={data}
		height={400}
		width={400}/>
  );
}

export default VisualSide
